import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate, useNavigate } from "react-router-dom";

function HomePage({ userRole }) {
  return <h1 className="text-xl">Welcome, {userRole}!</h1>;
}

function AddBookPage() {
  return <h1>Add Book</h1>;
}

function EditBookPage() {
  return <h1>Edit Book</h1>;
}

function BorrowPage() {
  return <h1>Borrow Book</h1>;
}

function PurchasePage() {
  return <h1>Purchase Book</h1>;
}

function ReturnPage() {
  return <h1>Return Book</h1>;
}

function LoginPage({ setUserRole }) {
  const navigate = useNavigate();

  const loginAs = (role) => {
    setUserRole(role);
    navigate("/");
  };

  return (
    <div className="p-6 space-y-4">
      <button onClick={() => loginAs("admin")} className="px-4 py-2 bg-blue-600 text-white">Login as Admin</button>
      <button onClick={() => loginAs("user")} className="px-4 py-2 bg-green-600 text-white">Login as User</button>
    </div>
  );
}

function LogoutButton({ setUserRole }) {
  const navigate = useNavigate();
  return (
    <button
      onClick={() => {
        setUserRole(null);
        navigate("/login");
      }}
      className="px-4 py-2 bg-red-600 text-white mt-4"
    >
      Logout
    </button>
  );
}

export default function App() {
  const [userRole, setUserRole] = useState(null);

  return (
    <Router>
      {!userRole ? (
        <Routes>
          <Route path="*" element={<LoginPage setUserRole={setUserRole} />} />
        </Routes>
      ) : (
        <div className="p-6 space-y-4">
          <Routes>
            <Route path="/" element={<><HomePage userRole={userRole} /><LogoutButton setUserRole={setUserRole} /></>} />
            {userRole === "admin" && (
              <>
                <Route path="/add-book" element={<AddBookPage />} />
                <Route path="/edit-book/:id" element={<EditBookPage />} />
              </>
            )}
            {userRole === "user" && (
              <>
                <Route path="/borrow" element={<BorrowPage />} />
                <Route path="/purchase" element={<PurchasePage />} />
                <Route path="/return" element={<ReturnPage />} />
              </>
            )}
            <Route path="*" element={<Navigate to="/" />} />
          </Routes>
        </div>
      )}
    </Router>
  );
}
